import requests
import time
import random
import shutil

for i in range(0, len(names)):
    time.sleep(random.uniform(.1, .5))

    player_id = names[i]["player_id"]
    url = f'https://midfield.mlbstatic.com/v1/people/{player_id}/spots/250'
    response = requests.get(url, stream=True)

    if response.status_code == 200:
        with open(f'../../assets/media/players2/{player_id}.jpg', 'wb') as file:
            for chunk in response.iter_content(chunk_size=128):
                file.write(chunk)
            print(f'Image successfully downloaded: {player_id}')
    else:
        shutil.copy('../../assets/media/players2/404.jpg', '../../assets/media/players2/{player_id}.jpg')
        print(f'Image {player_id} not found.')

    print(i+1, "of", len(names))
